        if (mnemonicLength>1) {
            let nextBiggest=Math.min(24,Math.max(12,Math.ceil(mnemonicLength/3)*3));
            $("#mnemonic_length").val(nextBiggest);
        } else {
            $("#mnemonic_length").val("1");
        }
